import Icons from "./Icons";
import "./Task.css";
export default function Task() {
  return (
    <div
      className="text"
      style={{
        padding: "0px 5px",
        display: "flex",
        justifyContent: "left",
        alignItem: "center",
        backgroundColor: "#252F88",
        margin: "20px 0",
        transition: ".3s",
      }}
    >
      <Icons />
      <div style={{ color: "white", flex: "1", marginLeft: "5px" }}>
        <h4>زيد الخير الحداد و يجب إنجاز هذا المشروع خلال يومين </h4>
        <p></p>
      </div>
    </div>
  );
}
